Tripping The Rift - Season 3, Episode 11

&quot;Extreme Take-Over&quot;

Original air date:  December 27th/2007 (Teletoon, Canada) 

Bob&amp;#039;s quote:  &quot;Eat your heart out, Millennium Falcon.&quot; 

Summary:  Chode enters Bob (and the crew) in a space race called &quot;The fifty million Kronig Flaming Collosus&quot;.  In an attempt to cheat himself into first place in the race, he gets Bob modified in a chop-shop.  But he soon finds out that he got more modifications done to Bob than he had wanted.
